import "./HeroStyles.css";

function Hero(props) {
  return (
    <>
      <div className="props.cName">
        <img
          alt="HerpImg"
          src={props.heroImg}
        />
        <div className="hero-text">
          <h1>{props.title}</h1>
          <p>Choose Your Favourite Destination.</p>
          <a href="/">Travel Plan</a>
        </div>
      </div>
    </>
  );
}

export default Hero;
